import {
    ADD_TODO,
    GET_TODO_EDIT_ID,
    ON_EDIT_TODO
} from '../actions/index'

const initialState = {
    todoList : [{
        id: 1,
        name: 'todo1',
        isCheck: true
    },{
        id: 2,
        name: 'todo2',
        isCheck: false
    }
    ]
}
const todosReducer = (state = initialState, action) => {
    const { todoList } = state
    const list = JSON.parse(JSON.stringify(todoList))
    switch (action.type) {
        case ADD_TODO:
            return Object.assign({}, state, {
                todoList: [...list,action.todo]
            })
        case ADD_TODO:
            return Object.assign({}, state, {
                todoList: [...list,action.todo]
            })
        case ADD_TODO:
            return Object.assign({}, state, {
                todoList: [...list,action.todo]
            })
        default:
            return state
    }
}
export default todosReducer
